import React, { Component } from 'react';
import jsPDF from 'jspdf';
//import imageToBase64 from 'image-to-base64/browser';
import {decode as base64_decode, encode as base64_encode} from 'base-64';
//import ImgToBase64 from 'react-native-image-base64';
class NameForm extends Component {
  constructor(props) {
    super(props);
    this.state = {name: 'Pragya'};
	 this.state = {imageData: ''};

    this.handleChange = this.handleChange.bind(this);
    this.handleSubmit = this.handleSubmit.bind(this);
	 this.onChange1 = this.onChange1.bind(this);
	  this.getBase64 = this.getBase64.bind(this);
	   this.onLoad = this.onLoad.bind(this);
	
  }




  onChange1 = (e) => {
    const files = e.target.files;
    const file = files[0];
	alert("File Name : " + file);
	//alert("File Name1 : " + file.name);
   this.getBase64(file);
  }
  
  onLoad = fileString => {
	 fileString = fileString + base64_encode("Header1111");
	 this.setState({imageData: fileString});
    //console.log(fileString);
  };

   getBase64 = file => {
    let reader = new FileReader();
    reader.readAsDataURL(file);
    reader.onload = () => {
      this.onLoad(reader.result);
    };
  };
// React Life Cycle
componentDidMount() {
    this.documentData = JSON.parse(localStorage.getItem('document'));
 
    if (localStorage.getItem('document')) {
        this.setState({
            name: this.documentData.name,
           description: this.documentData.description,
           price: this.documentData.price
    })
} else {
    this.setState({
        name: '',
        description: '',
        price: ''
    })
}
}  

  handleChange(event) {
	//localStorage.setItem('document',JSON.stringify(this.state));
    this.setState({name: event.target.value});
	
  }
   
  
  handleSubmit(event) {
	  
	localStorage.setItem('document',JSON.stringify(this.state));
   // alert('A name was submitted: ' +this.state.imageData);
   // console.log(this.state.imageData);
    event.preventDefault();
	
   
  // var imgData1 = 'data:image/jpeg;base64,'
    
 
    var doc = new jsPDF()

   doc.setFontSize(40)
   doc.text(10, 10, "Header !!!!!!!!!!!!!!!!!!!")
   doc.text(5, 40, this.state.name)
 //  alert ("Going to puplish:\n" + this.state.imageData);
   doc.addImage(this.state.imageData, 'JPEG', 75, 25,75,50);
   
   doc.text("Footer", 50, doc.internal.pageSize.height - 10);//
  doc.save("second.pdf");
   //doc.output("second.pdf");
  }

  render() {
    return (
      <form onSubmit={this.handleSubmit}>
        <label>
          Name:
          <input type="text" value={this.state.name} onChange={this.handleChange} />
        </label>
		<input type="file" onChange={this.onChange1} />
        <input type="submit" value="Submit" />
      </form>
    );
  }
}
export default NameForm;
